import React from "react";
import MtgCard from "./MtgCard";

function CardList({mtgCards}) {


    return(
        <div className="ui three stackable cards">
            <br></br>
            {mtgCards.map(mtgCard => (
                <MtgCard
                    key={mtgCard.id}
                    card={mtgCard.imageUrl}
                />
            ))}

        </div>
    )
}

export default CardList
